style.css:
/*http://userstyles.org/styles/80170/tumblr-card-rack-icon-bar?r=1355763568*/
@-moz-document url-prefix('http://www.tumblr.com'), url-prefix('https://www.tumblr.com')   {
#new_post {
  background-image: url("data:image/jpeg;base64,") !important;
  width: 532px !important;
  height: 92px !important;
  background-size: 450px 100px !important;
}
#new_post a {
  position: relative !important;
  z-index: 1001 !important;
}
#new_post .arrow:before {
  position: absolute !important;
  content: "" !important;
  left: 0px !important;
  width: 0px !important;
  height: 0px !important;
  border-top: solid 0px transparent !important;
  border-right: solid 45px rgba(0,0,0,.4) !important;
  border-bottom: solid 100px rgba(255,255,255,0) !important;
  border-left: solid 0px transparent !important;
  -moz-transform: scalex(-1) !important;
  -webkit-transform: scalex(-1) !important;
}
#new_post .arrow:after {
  position: absolute !important;
  content: "" !important;
  left: 494px !important;
  width: 0px !important;
  height: 0px !important;
  border-top: solid 0px red !important;
  border-right: solid 45px rgba(0,0,0,.4) !important;
  border-bottom: solid 100px rgba(255,255,255,0) !important;
  border-left: solid 0px black !important;
}
#new_post .arrow {
  top: 0px !important;
  left: 0px !important;
  width: 540px !important;
  height: 97px !important;
  background-size: 550px 25px !important;
  border-top: solid 3px rgba(0,0,0,.75) !important;
  box-shadow: inset 0px 5px 10px rgba(0,0,0,.75),
inset 0px 5px 15px rgba(0,0,0,.75) !important;
  border-radius: 0px !important;
}
#new_post {
  left: -3px !important;
  border-top: solid thick #dab378;
  border-right: solid 3px #b99459;
  border-bottom: solid 8px #ba955d !important;
  border-left: solid 3px #b99459;
}
#new_post > a {
  overflow: hidden !important;
 width: 62px !important;
  height: 0px !important;
  background:-moz-linear-gradient(top, rgba(120,120,120,.95) 0%, #fff 100%) !important;
  border-bottom: solid 3px rgba(0,0,0,.5) !important;
  background:-webkit-linear-gradient(top, rgba(120,120,120,.95) 0%, #fff 100%) !important;
  border-bottom: solid 3px rgba(0,0,0,.5) !important;
  box-shadow: inset 0px 0px 8px rgba(0,0,0,.25) !important;
}
#new_post > a:hover {
  background:-moz-linear-gradient(top, rgba(160,160,160,1) 0%, #fff 75%, #fff 100%) !important;
  background:-webkit-linear-gradient(top, rgba(160,160,160,1) 0%, #fff 75%, #fff 100%) !important;
}
#new_post > a:nth-child(1) {
 -moz-transform: matrix(.95, 0, -.6, .95, 28, 10);
 -webkit-transform: matrix(.95, 0, -.6, .95, 22, 10);
}
#new_post > a:nth-child(2) {
 -moz-transform: matrix(.95, 0, -.5, .95, 31, 10);
 -webkit-transform: matrix(.95, 0, -.5, .95, 25, 10);
}
#new_post > a:nth-child(3) {
 -moz-transform: matrix(.95, 0, -.3, .95, 35, 10);
 -webkit-transform: matrix(.95, 0, -.3, .95, 30, 10);
}
#new_post >a:nth-child(4) {
  transform-origin: 45px 75px;
  transform: rotateX(-75deg) perspective(640px) rotateX(72deg);
  left: 44px !important;
   top: 4px !important;
  height: 4px !important;
  border-right: solid 1px rgba(0,0,0,.15) !important;
  border-left: solid 1px rgba(0,0,0,.25) !important;
}
#new_post > a:nth-child(5) {
 -moz-transform: matrix(.95, 0, .3, .95, 53, 10);
 -webkit-transform: matrix(.95, 0, .3, .95, 53, 10);
}
#new_post > a:nth-child(6) {
 -moz-transform: matrix(.95, 0, .5, .95, 58, 10);
 -webkit-transform: matrix(.95, 0, .5, .95, 58, 10);
}
#new_post > a:nth-child(7) {
 -moz-transform: matrix(.95, 0, .6, .95, 62, 10);
 -webkit-transform: matrix(.95, 0, .6, .95, 62, 10);
}
#new_post > a:nth-child(n - 4) {
  border-radius: 4px !important;
  border-bottom-right-radius: 5px !important;
  border-bottom-left-radius: 12px !important;
  box-shadow: inset 0px 0px 8px rgba(0,0,0,.25),
                      -5px -3px 8px rgba(0,0,0,.35) !important;
}
#new_post > a:nth-child(n + 5) {
  border-bottom-right-radius: 12px !important;
  border-bottom-left-radius: 5px !important;
  box-shadow: inset 0px 0px 8px rgba(0,0,0,.25),
                      1px -3px 8px rgba(0,0,0,.5) !important;
}
#new_post > a:nth-child(4) {
  border-bottom-right-radius: 7px !important;
  border-bottom-left-radius: 10px !important;
  border-top-right-radius: 7px !important;
  border-top-left-radius: 4px !important;
}
#new_post > a:nth-child(n - 4):hover {
  border-bottom-right-radius: 40px !important;
  border-bottom-left-radius: 12px !important;
  box-shadow: inset 0px 0px 8px rgba(0,0,0,.25),
                      5px 10px 4px rgba(0,0,0,.65) !important;
}
#new_post > a:nth-child(n + 5):hover {
  border-bottom-right-radius: 6px !important;
  border-bottom-left-radius: 40px !important;
  box-shadow: inset 0px 0px 8px rgba(0,0,0,.25),
                      -5px 10px 4px rgba(0,0,0,.65) !important;
}
.new_post_label:hover {
  padding-top: 50px !important;
  color: black !important;
}
#new_post >a:nth-child(4) {
  transform-origin: 45px 75px;
  transform: rotateX(-75deg) perspective(640px) rotateX(72deg);
  left: 44px !important;
   top: 4px !important;
  height: 4px !important;
  border-right: solid 1px rgba(0,0,0,.15) !important;
  border-left: solid 1px rgba(0,0,0,.25) !important;
}
}
